public void repeatAndDistinctUnbounded() {
    Observable<Integer> src = Observable.fromIterable(Arrays.asList(1, 2, 3, 4, 5))
            .take(3)
            .repeat(3)
            .distinct();

    TestObserverEx<Integer> to = new TestObserverEx<Integer>();

    src.subscribe(to);

    to.assertNoErrors();
    to.assertTerminated();
    to.assertValues(1, 2, 3);
}

